import Header from './Header';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
function App () {
    return (
        <div className='Background'>
            <BrowserRouter>
                <Header></Header>
                <Switch>
                    <Route path="/" exact>
                        <div type = "welcome">
                            Welcome!
                        </div>
                    </Route>
                    <Route path="/signin" exact>註冊</Route>
                </Switch>
            </BrowserRouter>
        </div>
        
    );
}

export default App;
